import pickle
from tqdm.auto import tqdm
import torch
import numpy as np
import scipy

def rerank_hash_distance(b1, b2, reranking_distance):
    n1, d = b1.shape
    n2 = b2.shape[0]
    hash_distances = (d - np.dot(b1, b2.transpose()))

    distances = (d-np.dot(b1, b2.transpose())) / 2
    sorted_indices = np.argsort(distances, axis=1)
    reranking_indices = np.zeros(sorted_indices.shape, dtype=np.int64)
    for i in range(n1):
        #reranking_indices[i] = [idx for idx, dist in sorted(zip(distances[i, sorted_indices[i]], reranking_distance[i]))]       
        reranking_indices[i] = [idx for h_dist, r_dist, idx in sorted(zip(distances[i, sorted_indices[i]], reranking_distance[i], sorted_indices[i]))]
    return reranking_indices

@torch.no_grad()
def get_test_output(p, test_loader, model, device, max_iters=None):    
    # Initialize the distance matrix
    N1, N2 = test_loader.dataset.N1, test_loader.dataset.N2
    raw_prediction = np.zeros([N1, N2])
    similarity = np.zeros([N1, N2])
    all_h1, all_h2 = np.zeros([N1, p.model_kwargs.h_dim]), np.zeros([N2, p.model_kwargs.h_dim])
    for i, (id1, x1, id2, x2, target) in tqdm(enumerate(test_loader), total=len(test_loader)):
        if max_iters is not None and i > max_iters: #this flag is for testing
            break
        #h1, h2, prediction = model(x1.to(device), x2.to(device), return_only_hash=False)
        h1, h2, prediction = model(x1.to(device), x2.to(device), return_only_hash=False)
        id1, id2 = id1.detach().cpu().numpy(), id2.detach().numpy()
        all_h1[id1] = h1.detach().cpu().numpy()
        all_h2[id2] = h2.detach().cpu().numpy()
        raw_prediction[id1, id2] = prediction.detach().cpu().numpy()
        similarity[id1, id2] = target.detach().cpu().numpy()
        
    all_h1 = np.vstack(all_h1)
    all_h2 = np.vstack(all_h2)
    
    #TODO: this is not entirely correct, need to calculate this from the train set
    b1 = np.sign(all_h1)
    b2 = np.sign(all_h2)
    
    hash_distance = scipy.spatial.distance.cdist(b1, b2, metric='hamming')
        
    return {'hash_distance': hash_distance,             
            'raw_distance': 1-raw_prediction, #raw_prediction is similarity
            'target_distance': 1-similarity, #target is similarity
            'h1': all_h1, 'h2': all_h2}

@torch.no_grad()
def run_internal_eval(model, criterion, output):
    model.eval()
    h1 = output['h1']
    h2 = output['h2']
    target = output['target']
    prediction = output['prediction']
    print('Prediction [{:.04f}, {:.04f}], Target [{:.04f}, {:.04f}]'.format(
        prediction.min().item(), prediction.max().item(), target.min().item(), target.max().item()))
    total_loss, prediction_loss, uniform_frequency_loss, independent_bit_loss = criterion(h1, h2, prediction, target, model)      
    
    return {'total_loss': total_loss}

@torch.no_grad()
def run_external_eval(p, test_output, topk):
    
    hash_distance = test_output['hash_distance']
    raw_distance = test_output['raw_distance']
    target_distance = test_output['target_distance']
    
    raw_ranking = np.argsort(raw_distance, axis=1)
    hash_ranking = np.argsort(hash_distance, axis=1)
    target_ranking = np.argsort(target_distance, axis=1)
    
    reranked_hash_ranking = rerank_hash_distance(np.sign(test_output['h1']), np.sign(test_output['h2']), target_distance)
        
    raw_metrics = calculate_ranking_metrics(raw_ranking, target_ranking, topk=topk)
    hash_metrics = calculate_ranking_metrics(hash_ranking, target_ranking, topk=topk)
    reranked_metrics = calculate_ranking_metrics(reranked_hash_ranking, target_ranking, topk=topk)
    best_metrics = calculate_ranking_metrics(target_ranking, target_ranking, topk=topk)
    
    random_distance = np.random.randn(*raw_distance.shape)    
    random_ranking = np.argsort(random_distance, axis=1)
    random_metrics = calculate_ranking_metrics(random_ranking, target_ranking, topk=topk)
    
    return raw_metrics, hash_metrics, reranked_metrics, random_metrics, best_metrics
    
def calculate_single_table_ranking_metrics(pred, gt, topk=10):
    n1, n2 = pred.shape
    recall = np.zeros(pred.shape)
    precision = np.zeros(pred.shape)
    gt_topk = gt[:, :topk]
    for q in range(n1):
        rel_sum = 0
        for r in range(n2):
            if pred[q, r] in gt_topk[q]:
                rel_sum += 1
            recall[q, r] = rel_sum/topk
            precision[q, r] = rel_sum/(r+1)
    recall = np.mean(recall, axis=0)
    precision = np.mean(precision, axis=0)
    return recall, precision


@torch.no_grad()
def run_multitables_external_eval(p, test_output, topk):
    hash_distances = test_output['hash_distance']
    raw_distances = test_output['raw_distance']
    target_distance = test_output['target_distance']
    
    target_ranking = np.argsort(target_distance, axis=1)
    best_metrics = calculate_ranking_metrics(target_ranking, target_ranking, topk=topk)
    random_distance = np.random.randn(*raw_distance.shape)    
    random_ranking = np.argsort(random_distance, axis=1)
    random_metrics = calculate_ranking_metrics(random_ranking, target_ranking, topk=topk)
    
    raw_metrics = {}
    hash_metrics = {}
    reranked_metrics = {}
    
    for hash_distance, raw_distance, h1, h2 in zip(hash_distances, raw_distances, test_output['h1'], test_output['h2']):
        raw_ranking = np.argsort(raw_distance, axis=1)
        hash_ranking = np.argsort(hash_distance, axis=1)
        reranked_hash_ranking = rerank_hash_distance(np.sign(h1), np.sign(h2), target_distance)
        
        raw_recall, raw_precision = calculate_single_table_ranking_metrics(raw_ranking, target_ranking, topk=topk)
        hash_recall, hash_precision = calculate_single_table_ranking_metrics(hash_ranking, target_ranking, topk=topk)
        reranked_recall, reranked_precision = calculate_single_table_ranking_metrics(reranked_hash_ranking, target_ranking, topk=topk)
    
    return raw_metrics, hash_metrics, reranked_metrics, random_metrics, best_metrics
    
def calculate_ranking_metrics(pred, gt, topk=10):
    n1, n2 = pred.shape
    recall = np.zeros(pred.shape)
    precision = np.zeros(pred.shape)
    gt_topk = gt[:, :topk]
    for q in range(n1):
        rel_sum = 0
        for r in range(n2):
            if pred[q, r] in gt_topk[q]:
                rel_sum += 1
            recall[q, r] = rel_sum/topk
            precision[q, r] = rel_sum/(r+1)
    recall = np.mean(recall, axis=0)
    precision = np.mean(precision, axis=0)
    return {'recall': recall, 'precision': precision, 'ranking': pred}        


